<template>
  <div class="container">
    <div class="name-wrapper">
      <div class="name">{{data.storeName}}32132131321</div>
    </div>
    <div class="operation">
      <div class="like">
        <img :src="like"/>
        <div class="text">点赞</div>
      </div>
      <div class="share">
        <img :src="share"/>
        <div class="text">分享</div>
      </div>
    </div>
    <div class="bottom">
      <div class="index" @tap="goIndex">首页</div>
      <div class="decoration" @tap="showImgList()">装修</div>
      <div class="menu" @tap="goProductList">菜单</div>
    </div>
    <div class="img-list" v-if="isShowImgList">
      <div class="btn">
        <div class="cancel" @tap="closeImgList()">取消</div>
        <div class="confirm">确定</div>
      </div>
      <ul>
        <li v-for="(item,index) in imgList" :key="index" class="item">
          <img :src="item.image"/>
        </li>
      </ul>
    </div>
  </div>
</template>

<script>
  import {fetchWFXMember} from 'api/index';

  /**
   * 芳聊馆--店铺装修
   */
  export default {
    data() {
      return {
        like: require('public/images/flg/shop-decoration/like.png'),
        share: require('public/images/flg/shop-decoration/share.png'),
        bg: require('public/images/flg/2.jpg'),
        userInfo: {},
        data: {},
        isShowImgList: false,
        imgList: [
          {image: require('public/images/flg/2.jpg'), index: 0},
          {image: require('public/images/flg/shop-decoration/share.png'), index: 1},
          {image: require('public/images/flg/shop-decoration/like.png'), index: 2},
          {image: require('public/images/flg/2.jpg'), index: 3},
          {image: require('public/images/flg/2.jpg'), index: 4},
          {image: require('public/images/flg/2.jpg'), index: 5},
          {image: require('public/images/flg/2.jpg'), index: 6},
          {image: require('public/images/flg/2.jpg'), index: 7}
        ]
      };
    },
    components: {},
    computed: {},
    methods: {
      async fetchWFXMember() {
        let res = await fetchWFXMember({id: this.userInfo.memberId, passportId: this.userInfo.id});
        if (res.firstErrorMessage === '') {
          this.data = res.wfxMember;
        } else {
          this.$bridge.dialog.alert({content: res.firstErrorMessage});
        }
      },
      goIndex() {
        this.$bridge.link.goIndex();
      },
      closeImgList() {
        this.isShowImgList = false;
      },
      showImgList() {
        this.isShowImgList = true;
      },
      goProductList() {
        this.$bridge.link.navigateTo('/pages/flg/product-list/main');
      }
    },
    onShow() {
      this.userInfo = this.$bridge.storage.get('userInfo');
      this.fetchWFXMember();
    }
  };
</script>

